const ListProductsCarrinho = ({produtos}) => {

    return(
        <div>
            <ul>
                {produtos.map(e => <li key={e.id}>
                    <figure>
                        <img src={e.imageUrl} alt={e.produtoNome} />
                        <figcaption>{e.produtoNome}</figcaption>
                    </figure>
                    <p>{e.preco}</p>
                </li> )}
            </ul>
        </div>
    )
}

export default ListProductsCarrinho
